import React, { useState } from 'react';
import { Button, FormControl, Select, MenuItem, FormLabel, FormControlLabel, Checkbox } from '@mui/material';
import { GridContainer, GridItem } from 'components/Grid';
import CustomInput from 'components/CustomInput';
import SearchIcon from '@mui/icons-material/Search';
import FindReplaceIcon from '@mui/icons-material/FindReplace';
import { Table } from 'antd';
import { EditableCell } from 'components/EditableCell';

const FILTER_DAYS = [
    { id: '1', name: 'Today' },
    { id: '2', name: 'Last 7 Days' },
    { id: '3', name: 'This Month' },
    { id: '4', name: 'Last Month' },
    // Add more filter options as needed
];

function YourComponent({ classes, data, columns, loading }) {
    const [prefijoSeleccionado, setPrefijoSeleccionado] = useState('');
    const [terceroSeleccionado, setTerceroSeleccionado] = useState('');
    const [estadoDianSeleccionado, setEstadoDianSeleccionado] = useState('vacio');
    const [fechaControlado, setFechaControlado] = useState('');
    const [fechaInicialInput, setFechaInicialInput] = useState('');
    const [fechaFinalInput, setFechaFinalInput] = useState('');
    const [respuestaCliente, setRespuestaCliente] = useState('vacio');
    const [enableFechaPersonalizada, setEnableFechaPersonalizada] = useState(false);
    const [fechaPersonalizada, setFechaPersonalizada] = useState(false);

    const aplicarFiltros = (apply) => {
        // Logic to apply filters
        console.log('Applying filters:', apply);
    };

    const limpiarFiltros = () => {
        setPrefijoSeleccionado('');
        setTerceroSeleccionado('');
        setEstadoDianSeleccionado('vacio');
        setFechaControlado('');
        setFechaInicialInput('');
        setFechaFinalInput('');
        setRespuestaCliente('vacio');
        setEnableFechaPersonalizada(false);
    };

    const activarFechaPersonalizada = () => {
        setEnableFechaPersonalizada(!enableFechaPersonalizada);
    };

    const OnChangeFecha = (value) => {
        setFechaControlado(value);
    };

    return (
        <>
            <GridContainer>
                <GridItem xs={12} sm={12} md={2}>
                    <FormLabel className={classes.label}>Prefijo</FormLabel>
                </GridItem>
                <GridItem xs={12} sm={12} md={3}>
                    <FormControl fullWidth className={classes.selectFormControl}>
                        <Select
                            MenuProps={{ className: classes.selectMenu }}
                            classes={{ select: classes.select }}
                            displayEmpty
                            value={prefijoSeleccionado}
                            onChange={(e) => setPrefijoSeleccionado(e.target.value)}
                        >
                            <MenuItem
                                key="vacio"
                                value=""
                                classes={{
                                    root: classes.selectMenuItem,
                                    selected: classes.selectMenuItemSelected,
                                }}
                            >
                                Sin prefijo
                            </MenuItem>
                            {/* Add more MenuItems dynamically if needed */}
                        </Select>
                    </FormControl>
                </GridItem>

                <GridItem xs={12} sm={12} md={2}>
                    <FormLabel className={classes.label}>Terceros</FormLabel>
                </GridItem>
                <GridItem xs={12} sm={12} md={3}>
                    <CustomInput
                        margin="dense"
                        id="tercero"
                        labelText="Tercero"
                        formControlProps={{ fullWidth: true }}
                        inputProps={{
                            type: "text",
                            onChange: (e) => setTerceroSeleccionado(e.target.value),
                            value: terceroSeleccionado,
                        }}
                    />
                </GridItem>

                <GridItem xs={12} sm={12} md={2}>
                    <FormLabel className={classes.label}>Estado DIAN:</FormLabel>
                </GridItem>
                <GridItem xs={12} sm={12} md={2}>
                    <FormControl fullWidth className={classes.selectFormControl}>
                        <Select
                            MenuProps={{ className: classes.selectMenu }}
                            classes={{ select: classes.select }}
                            displayEmpty
                            value={estadoDianSeleccionado}
                            onChange={(e) => setEstadoDianSeleccionado(e.target.value)}
                        >
                            <MenuItem
                                key="vacio"
                                value="vacio"
                                classes={{
                                    root: classes.selectMenuItem,
                                    selected: classes.selectMenuItemSelected,
                                }}
                            >
                                Todos
                            </MenuItem>
                            <MenuItem
                                key="1"
                                value="0"
                                classes={{
                                    root: classes.selectMenuItem,
                                    selected: classes.selectMenuItemSelected,
                                }}
                            >
                                No enviado
                            </MenuItem>
                            <MenuItem
                                key="2"
                                value="1"
                                classes={{
                                    root: classes.selectMenuItem,
                                    selected: classes.selectMenuItemSelected,
                                }}
                            >
                                Enviado
                            </MenuItem>
                        </Select>
                    </FormControl>
                </GridItem>

                <GridItem xs={12} sm={12} md={1}>
                    <FormLabel className={classes.label}>Fecha</FormLabel>
                </GridItem>
                <GridItem xs={12} sm={6} md={2}>
                    <FormControl fullWidth className={classes.selectFormControl}>
                        <Select
                            MenuProps={{ className: classes.selectMenu }}
                            classes={{ select: classes.select }}
                            displayEmpty
                            value={fechaControlado}
                            onChange={(e) => OnChangeFecha(e.target.value)}
                            disabled={!enableFechaPersonalizada}
                        >
                            <MenuItem disabled value="" classes={{ root: classes.selectMenuItem }}>
                                Seleccione un filtro
                            </MenuItem>
                            {FILTER_DAYS.map(({ name, id }) => (
                                <MenuItem
                                    key={id}
                                    value={id}
                                    classes={{
                                        root: classes.selectMenuItem,
                                        selected: classes.selectMenuItemSelected,
                                    }}
                                >
                                    {name}
                                </MenuItem>
                            ))}
                        </Select>
                    </FormControl>
                </GridItem>

                <GridItem xs={12} sm={12} md={2}>
                    <FormControlLabel
                        control={
                            <Checkbox
                                style={{ color: primaryColor[0] }}
                                tabIndex={-1}
                                onClick={activarFechaPersonalizada}
                            />
                        }
                        classes={{ label: classes.label, root: classes.labelRoot }}
                        label="Â¿Desea un rango personalizado?"
                    />
                </GridItem>

                <GridItem xs={12} sm={12} md={1}>
                    <FormLabel className={classes.label}>Desde</FormLabel>
                </GridItem>
                <GridItem xs={12} sm={12} md={2}>
                    <CustomInput
                        margin="dense"
                        id="fechaInicial"
                        formControlProps={{ fullWidth: true }}
                        inputProps={{
                            type: "date",
                            onChange: (e) => setFechaInicialInput(e.target.value),
                            value: fechaInicialInput,
                            disabled: enableFechaPersonalizada,
                        }}
                    />
                </GridItem>

                <GridItem xs={12} sm={12} md={1}>
                    <FormLabel className={classes.label}>Hasta</FormLabel>
                </GridItem>
                <GridItem xs={12} sm={12} md={2}>
                    <CustomInput
                        margin="dense"
                        id="fechaFinal"
                        formControlProps={{ fullWidth: true }}
                        inputProps={{
                            type: "date",
                            onChange: (e) => setFechaFinalInput(e.target.value),
                            value: fechaFinalInput,
                            disabled: enableFechaPersonalizada,
                        }}
                    />
                </GridItem>

                <GridItem xs={12} sm={12} md={2}>
                    <FormLabel className={classes.label}>Respuesta Cliente</FormLabel>
                </GridItem>
                <GridItem xs={12} sm={12} md={2}>
                    <FormControl fullWidth className={classes.selectFormControl}>
                        <Select
                            MenuProps={{ className: classes.selectMenu }}
                            classes={{ select: classes.select }}
                            displayEmpty
                            value={respuestaCliente}
                            onChange={(e) => setRespuestaCliente(e.target.value)}
                        >
                            <MenuItem
                                key="0"
                                value="vacio"
                                classes={{
                                    root: classes.selectMenuItem,
                                    selected: classes.selectMenuItemSelected,
                                }}
                            >
                                Sin respuesta
                            </MenuItem>
                            <MenuItem
                                key="1"
                                value="Rechazado"
                                classes={{
                                    root: classes.selectMenuItem,
                                    selected: classes.selectMenuItemSelected,
                                }}
                            >
                                Rechazado
                            </MenuItem>
                            <MenuItem
                                key="2"
                                value="Aceptado"
                                classes={{
                                    root: classes.selectMenuItem,
                                    selected: classes.selectMenuItemSelected,
                                }}
                            >
                                Aceptado
                            </MenuItem>
                        </Select>
                    </FormControl>
                </GridItem>
            </GridContainer>

            <div style={{ marginTop: 15 }}>
                <Button
                    color="primary"
                    onClick={() => aplicarFiltros(true)}
                    variant="contained"
                    size="small"
                >
                    <SearchIcon /> Aplicar filtros
                </Button>
                <Button
                    color="secondary"
                    onClick={limpiarFiltros}
                    variant="contained"
                    size="small"
                    style={{ marginLeft: 10 }}
                >
                    <FindReplaceIcon /> Limpiar filtros
                </Button>
            </div>

            {/* Table Component */}
            <Table
                bordered
                dataSource={data}
                columns={columns}
                rowKey={(record) => record.id} // Ensure each row has a unique identifier
                loading={loading}
                pagination={{ pageSize: 5 }}
                components={{
                    body: {
                        cell: EditableCell,
                    },
                }}
            />
        </>
    );
}

export default YourComponent;
